  textAlign:'center',
  margin: '5vh',
  height: '5vh',
  width: '25vw',
  fontSize: '4vh',
  fontFamily: "Trebuchet MS"
};

const Layout = props => (
<div>
  <input style={layoutStyle} type="text" />
</div>
);

export default Layout;
